// CartProducts.js
import React from 'react';

const CartProducts = ({ cart }) => {

    console.log(cart)

  return (
    <div>
      <h2>Cart</h2>
      {cart.length === 0 ? (
        <p>Your cart is empty</p>
      ) : (
        <ul>
          {cart.map((item) => (
            <li key={item.id}>
              {item.title}
              {item.quantity}
              {item.price}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default CartProducts;
